import React from 'react';
import { motion } from 'framer-motion';
import { TypeAnimation } from 'react-type-animation';
import { Linkedin, Mail, ArrowDown, Sparkles, Heart, Sun, Calendar } from 'lucide-react';

const Hero = () => {
  const scrollToAbout = () => {
    const element = document.getElementById('about');
    if (element) element.scrollIntoView({ behavior: 'smooth' });
  };

  return (
    <section className="relative min-h-screen flex items-center justify-center overflow-hidden pt-20 bg-[#050505]" id="hero">
      {/* Background Gradients - Softer, Warm Zen Tones */}
      <div className="absolute top-0 left-0 w-full h-full overflow-hidden -z-10">
        <div className="absolute top-[-10%] left-[-10%] w-[50%] h-[50%] bg-orange-500/10 rounded-full blur-[120px]" />
        <div className="absolute bottom-[-10%] right-[-10%] w-[50%] h-[50%] bg-blue-500/10 rounded-full blur-[120px]" />
      </div>

      <div className="container mx-auto px-4 md:px-6 relative z-10">
        <div className="flex flex-col-reverse lg:flex-row items-center justify-between gap-12">

          {/* Text Content */}
          <motion.div
            className="flex-[1.2] text-center lg:text-left"
            initial={{ opacity: 0, x: -50 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8 }}
          >
            <motion.div
              className="inline-flex items-center gap-2 mb-6 px-4 py-1.5 rounded-full bg-white/5 border border-white/10 text-orange-400 font-medium text-sm backdrop-blur-sm"
              initial={{ opacity: 0, y: -20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: 0.2 }}
            >
              <Sparkles size={14} />
              <span>Transform Your Journey</span>
            </motion.div>

            <motion.h1
              className="text-5xl md:text-8xl font-bold bg-clip-text text-transparent bg-gradient-to-r from-white via-gray-100 to-gray-400 mb-6 tracking-tighter leading-[1.1]"
              initial={{ opacity: 0, y: 30 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: 0.4, duration: 0.8 }}
            >
              Mamtha <br /> Gowda G S
            </motion.h1>

            <motion.div
              className="text-2xl md:text-4xl text-gray-300 font-light mb-8 h-12"
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ delay: 0.6 }}
            >
              I help you master your{' '}
              <TypeAnimation
                sequence={[
                  'Mindset', 2000,
                  'Career Growth', 2000,
                  'Self-Discovery', 2000,
                  'Resilience', 2000,
                ]}
                wrapper="span"
                speed={50}
                repeat={Infinity}
                className="font-bold text-orange-500 italic"
              />
            </motion.div>

            <motion.p
              className="text-lg md:text-xl text-gray-400 mb-10 max-w-2xl mx-auto lg:mx-0 leading-relaxed font-light"
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ delay: 0.8 }}
            >
              Empowering ambitious individuals to bridge the gap between where they are and where they want to be through actionable strategies and soulful coaching.
            </motion.p>

            {/* CTA Buttons - Life Coach Oriented */}
            <motion.div
              className="flex flex-wrap items-center justify-center lg:justify-start gap-4 mb-12"
              initial={{ opacity: 0, y: 30 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ delay: 1, duration: 0.8 }}
            >
              <motion.a
                href="#contact"
                className="px-10 py-4 bg-white text-black rounded-2xl font-bold hover:bg-orange-500 hover:text-white transition-all shadow-xl flex items-center gap-2"
                whileHover={{ y: -5 }}
                whileTap={{ scale: 0.95 }}
              >
                <Calendar size={20} />
                Book a Discovery Call
              </motion.a>

              <motion.a
                href="#about"
                className="px-10 py-4 bg-white/5 border border-white/10 text-white rounded-2xl font-bold hover:bg-white/10 transition-all backdrop-blur-sm flex items-center gap-2"
                whileHover={{ y: -5 }}
                whileTap={{ scale: 0.95 }}
              >
                My Philosophy
              </motion.a>
            </motion.div>

            {/* Social Proof Row */}
            <motion.div
              className="flex flex-wrap items-center justify-center lg:justify-start gap-8 text-gray-400"
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ delay: 1.2 }}
            >
              <div className="flex items-center gap-3">
                <div className="flex -space-x-3">
                  {[1, 2, 3, 4].map((i) => (
                    <div key={i} className="w-10 h-10 rounded-full border-2 border-black bg-neutral-800 flex items-center justify-center overflow-hidden">
                       <span className="text-[10px] text-orange-500">â˜…</span>
                    </div>
                  ))}
                </div>
                <div className="text-left leading-tight">
                  <div className="text-white font-bold text-sm">50+ Lives Impacted</div>
                  <div className="text-[10px] uppercase tracking-widest text-gray-500">Mindset Coaching</div>
                </div>
              </div>

              <div className="h-8 w-px bg-white/10 hidden md:block" />

              <div className="flex gap-4">
                <motion.a href="https://linkedin.com/in/..." target="_blank" className="p-2 hover:text-orange-500 transition-colors bg-white/5 rounded-full border border-white/10"><Linkedin size={20} /></motion.a>
                <motion.a href="mailto:..." className="p-2 hover:text-orange-500 transition-colors bg-white/5 rounded-full border border-white/10"><Mail size={20} /></motion.a>
              </div>
            </motion.div>
          </motion.div>

          {/* Visual Side - Zen/Growth Inspired */}
          <motion.div
            className="flex-1 relative max-w-md w-full"
            initial={{ opacity: 0, scale: 0.8 }}
            animate={{ opacity: 1, scale: 1 }}
            transition={{ delay: 0.5, duration: 1 }}
          >
            <div className="relative flex justify-center items-center">
              {/* Soft Aura Ring */}
              <motion.div
                animate={{ rotate: [0, 360] }}
                transition={{ duration: 20, repeat: Infinity, ease: "linear" }}
                className="absolute -inset-4 rounded-[40px] border border-orange-500/20"
              />

              {/* Main Image Container */}
              <div className="relative w-72 h-96 md:w-[400px] md:h-[500px] rounded-[30px] overflow-hidden border border-white/10 shadow-2xl z-10 group">
                <img
                  src="/images/Mamtha.jpeg"
                  alt="Mamtha Gowda G S"
                  className="w-full h-full object-cover transition-transform duration-1000 group-hover:scale-105"
                />
                <div className="absolute inset-0 bg-gradient-to-t from-black/60 via-transparent to-transparent opacity-60" />
              </div>

              {/* Floating Mindset Badge */}
              <motion.div
                className="absolute -bottom-6 -right-4 bg-white/90 backdrop-blur-xl px-6 py-4 rounded-3xl border border-white/10 z-20 shadow-2xl text-black"
                initial={{ x: 20, opacity: 0 }}
                animate={{ x: 0, opacity: 1 }}
                transition={{ delay: 1.5 }}
              >
                <div className="flex items-center gap-3">
                  <div className="p-2 bg-orange-100 rounded-xl">
                    <Sun className="text-orange-600" size={20} />
                  </div>
